import React from 'react';
import { useParams } from 'react-router-dom';
import data from '../data.json';
import { jugadores } from '../jugadores';
import { jugadoresColombia } from '../jugadoresColombia';
import '../componentes/estilos/Match.css';

const titularesArgentina = [
  { "POS": 23, "Nombre": "Emiliano Martínez" },
  { "POS": 4, "Nombre": "Gonzalo Montiel" },
  { "POS": 13, "Nombre": "Cristian Romero" },
  { "POS": 25, "Nombre": "Lisandro Martínez" },
  { "POS": 3, "Nombre": "Nicolás Tagliafico" },
  { "POS": 7, "Nombre": "Rodrigo De Paul" },
  { "POS": 24, "Nombre": "Enzo Fernández" },
  { "POS": 20, "Nombre": "Alexis Mac Allister" },
  { "POS": 11, "Nombre": "Ángel Di María" },
  { "POS": 10, "Nombre": "Lionel Messi (C)" },
  { "POS": 9, "Nombre": "Julián Álvarez" }
];

const titularesColombia = [
  { "POS": 12, "Nombre": "Camilo Vargas" },
  { "POS": 4, "Nombre": "Santiago Arias" },
  { "POS": 23, "Nombre": "Dávinson Sánchez" },
  { "POS": 2, "Nombre": "Carlos Cuesta" },
  { "POS": 17, "Nombre": "Johan Mojica" },
  { "POS": 6, "Nombre": "Richard Rios" },
  { "POS": 16, "Nombre": "Jefferson Lerma" },
  { "POS": 11, "Nombre": "Jhon Arias" },
  { "POS": 10, "Nombre": "James Rodríguez" },
  { "POS": 24, "Nombre": "Jhon Córdoba" },
  { "POS": 7, "Nombre": "Luis Díaz" }
];

const Match = () => {
  const { matchId } = useParams();
  const match = data.upcomingMatches.find(m => m.id === parseInt(matchId));

  if (!match) {
    return <div>Partido no encontrado</div>;
  }

  const team1Players = jugadores.filter(player => titularesArgentina.some(titular => titular.POS === player.POS));
  const team2Players = jugadoresColombia.filter(player => titularesColombia.some(titular => titular.POS === player.POS));

  return (
    <div>
      <h2>Formación del Partido: {match.team1} vs {match.team2}</h2>
      <div className="field">
        {team1Players.map(player => (
          <div className="player" style={getPlayerStyle(player.POS, match.team1)} key={player.POS}>
            <div className="player-number">{player.POS}</div>
            <div className="tooltip">{player.Nombre}</div>
          </div>
        ))}
        {team2Players.map(player => (
          <div className="player" style={getPlayerStyle(player.POS, match.team2)} key={player.POS}>
            <div className="player-number">{player.POS}</div>
            <div className="tooltip">{player.Nombre}</div>
          </div>
        ))}
      </div>
    </div>
  );
};

// Función para obtener los estilos de posición de los jugadores
const getPlayerStyle = (pos, team) => {
  const positionsArgentina = {
    23: { top: '38%', left: '2.5%' }, // Posición de Emiliano Martínez
    4: { top: '63%', left: '5%' },  // Posición de Gonzalo Montiel
    13: { top: '50%', left: '5.5%' }, // Posición de Cristian Romero
    25: { top: '28%', left: '6.5%' }, // Posición de Lisandro Martínez
    3: { top: '17%', left: '6.5%' },  // Posición de Nicolás Tagliafico
    7: { top: '62%', left: '13.5%' },  // Posición de Rodrigo De Paul
    24: { top: '49%', left: '13%' }, // Posición de Enzo Fernández
    20: { top: '37%', left: '12%' }, // Posición de Alexis Mac Allister
    11: { top: '20%', left: '14%' }, // Posición de Ángel Di María
    10: { top: '47%', left: '20%' }, // Posición de Lionel Messi
    9: { top: '30%', left: '20%' }, // Posición de Julián Álvarez
  };

  const positionsColombia = {
    12: { top: '38%', right: '2.5%' }, // Posición de Camilo Vargas
    4: { top: '63%', right: '5%' },  // Posición de Santiago Arias
    23: { top: '50%', right: '5.5%' }, // Posición de Dávinson Sánchez
    2: { top: '28%', right: '6.5%' }, // Posición de Carlos Cuesta
    17: { top: '17%', right: '6.5%' },  // Posición de Johan Mojica
    6: { top: '62%', right: '13.5%' },  // Posición de Richard Rios
    16: { top: '49%', right: '13%' }, // Posición de Jefferson Lerma
    11: { top: '37%', right: '12%' }, // Posición de Jhon Arias
    10: { top: '20%', right: '14%' }, // Posición de James Rodríguez
    24: { top: '47%', right: '20%' }, // Posición de Jhon Córdoba
    7: { top: '30%', right: '20%' }, // Posición de Luis Díaz
  };

  return team === 'Argentina' ? positionsArgentina[pos] : positionsColombia[pos];
};

export default Match;
